(1806, 1, 'Folha', 'GERA FOLHA MONITOR', 'SELECT f.id_folha, m.id_monitor, m.nome as monitor, m.id_professor as id_orientador,         p.nome as orientador, m.id_curso, c.nome as curso, m.turma,         m.id_turno, \'\' as turno, m.setor, m.horario_seg, m.horario_ter, m.horario_qua, m.horario_qui,         m.horario_sex, 0 as qtde_faltas, 0 as qtde_justificada    FROM monitor m, folha f, professor p, curso c   where m.id_professor = p.id_professor and m.id_curso = c.id_curso     and f.id_folha in (select max(id_folha) as id from folha) ord', NULL, '2019-11-28', '10:02:36'),
