(2927, 2, 'REL_MAPAFALTAS', 'RELATORIO', 'SELECT c.id_coordenacao, c.nome, f.id_professor, p.nome,        f.data, f.turno, f.horario_1, f.horario_2,       f.horario_3, f.horario_4, f.horario_5, f.horario_6  FROM faltas f, professor p, coordenacao c where f.id_professor = p.id_professor   and p.id_coordenacao = c.id_coordenacao   and f.data between \'2020-02-01\' and \'2020-02-29\'  order by c.nome, p.nome, f.data', 'ACESSO EM :03/03/2020 09:48:22', '2020-03-03', '09:48:22'),
(2928, 2, 'REL_FALTAS', 'RELATORIO', 'SELECT f.id_faltas, f.id_professor, p.nome, f.data, f.turno, (if(trim(f.horario_1) = \' \',0,1)+if(trim(f.horario_2) = \' \',0,1)+        if(trim(f.horario_3) = \' \',0,1)+if(trim(f.horario_4) = \' \',0,1)+if(trim(f.horario_5) = \' \',0,1)+         if(trim(f.horario_6) = \' \',0,1)) as n_faltas   FROM faltas f, professor p where f.id_professor = p.id_professor   and f.data between \'2020-02-01\' and \'2020-02-29\'  order by p.nome, f.data', 'ACESSO EM :03/03/2020 09:56:46', '2020-03-03', '09:56:46'),
(2929, 2, 'REL_FECHAMENTOS', 'RELATORIO', 'SELECT id_fechamento, data_inicial, data_final, turno, tipo, observacao   FROM fechamento order by id_fechamento desc', 'ACESSO EM :03/03/2020 09:57:08', '2020-03-03', '09:57:08'),
